import NavBar_logo from "./images/gitdp.jpg";
import "./App.css";
import React from "react";
// import Navbar from "./Components/Navbar";
import Bgi from "./Components/bgi";
import Skill from "./Components/skill.js";
import { skilldata } from "./Components/skilldata";
import Aboutme from "./Components/Aboutme";
import Projects from "./Components/projects";
import Footer from "./Components/footer";
import {
  createBrowserRouter,
  createRoutesFromElements,
  Route,
  Link,
  Outlet,
  RouterProvider,
} from "react-router-dom";

export default function App() {
  const router = createBrowserRouter(
    createRoutesFromElements(
      <Route path="/" element={<Root />}>
        <Route index element={<Bgi />} />
        <Route path="/Comp" index={<Aboutme />} />
        <Route path="/skills" index={<Skill slides={skilldata} />} />
        <Route path="/projects" index={<Projects />} />
        <Route path="/footer" index={<Footer />} />
      </Route>
    )
  );

  return (
    <>
      {/* <Navbar /> */}

      {/* <Bgi />
      <Aboutme />
      <Skill slides={skilldata} />
      <Projects />
      <Footer /> */}
      <RouterProvider router={router} />
    </>
  );
}

const Root = () => {
  return (
    <>
      <nav className="navbar bg-black fixed-top navbar-expand-lg text-light ">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">
            <img src={NavBar_logo} alt="Bootstrap" width="40" height="34" />
          </Link>
          <Link to="/" className="navbar-brand nav-link text-light">
            Home
          </Link>
          {/* <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
                    </button> */}

          <div
            className="collapse navbar-collapse"
            id="navbarSupportedContent "
          >
            <div className="mx-auto text-light ">
              <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                <li className="nav-item">
                  <Link className="nav-link text-light" to="/Comp">
                    About Me
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link text-light" to="/skills">
                    Technical Skills
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link text-light" to="/projects">
                    Projects
                  </Link>
                </li>
              </ul>
            </div>
            <div className="d-flex mx-3">
              <Link className="nav-link text-light" to="/footer">
                Connect With Me
              </Link>
            </div>
          </div>
        </div>
      </nav>

      <div>
        <Outlet />
      </div>
    </>
  );
};
